class ListNode:
	def __init__(self, x):
		self.val = x
		self.next = None

def merge(lHead, lNum, rHead, rNum):
	lHead=sort(lHead,lNum)
	rHead=sort(rHead,rNum)
	head=tail=ListNode(0)
	while lHead!=None or rHead!=None:
		if rHead==None or (lHead!=None and lHead.val < rHead.val):
			tail.next=lHead
			lHead=lHead.next
		else:
			tail.next=rHead
			rHead=rHead.next
		tail=tail.next
	tail.next=None
	return head.next

def print_list(head):
	temp=head
	while temp!=None:
		print(temp.val)
		temp=temp.next
	print("######")

def sort(head, numOfNodes):
	# only one node or only one node
	if head == None or head.next == None:
		return head
	lHead=rHead=head
	for i in range(0, numOfNodes//2):
		tempHead=rHead
		rHead=rHead.next
	tempHead.next=None
	# print(rHead)
	# print_list(lHead)
	# print_list(rHead)
	head=merge(lHead, numOfNodes//2, rHead, (numOfNodes+1)//2)
	
	return head

def sortList(head):
	# count length of the link
	p = head
	numOfNodes = 0
	while p != None:
		numOfNodes += 1
		p = p.next
	return sort(head, numOfNodes)

